const LeagueBar = () => {


    return (
        <div id = "LeagueBar">
            <BarButton function = {setLeague} name = "All"></BarButton>
            <BarButton function = {setSent} name = "Sent"></BarButton>
            <BarButton function = {setAdd} name = "Add League"></BarButton>
        </div>
        )
}

export default LeagueBar;
